(2, '', 'resolved', 117, 'Ashiq', '9761111683', '', 1, '1', '', NULL, 'consultation', '0000-00-00', 1, 13, 'यह बीमारी ज्यादातर बड़े  पौधों में देखने को मिलती है , यह प्रक्रिया  पौधे में मिट्टी के अंदर  जड़ में  होती है  और पौधो मे पत्तिया नीचे से पीली होने लगती है |  तथा पीलापन नीचे से ऊपर की पत्तियों मे बढ़ने लगता है  और पौधे के बढ़वार प्रभावित होती है |', '<p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px; line-height: normal;\"><span style=\"font-size: 13.3333px;\">पपीते के लिए अच्छी जल निकासी वाली जमीन का चुनाव बहुत जरूरी होता है , इसके अलावा पपीते मे सिंचाई के समय इस बात का पूरा ध्यान रखें की पानी सीधे जड़ या तने के संपर्क मे ना आने पाए बल्कि हल्की सी नमी ही पौधे की जड़ तक पहुच सके सिर्फ उतनी ही सिंचाई करनी चाहिए | </span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px; line-height: normal;\"><span style=\"font-size: 10pt;\">निम्नलिखित  फंगीसाइड में से किसी भी एक को स्प्रे या द्रिंच करें और 10 दिन बाद दोहराएं  | </span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px; line-height: normal;\"><span lang=\"EN-US\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px; line-height: normal;\"><span lang=\"EN-US\"><br>Copper Oxychloride (50% WP) (2  g/1 liter of water)<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px; line-height: normal;\"><span lang=\"EN-US\">Thiophanate Methyl 70% w/w  (2 g/1 liter of water)</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px; line-height: normal;\">दोनों को मिलाकर प्रयोग करें </p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px; line-height: normal;\"><br></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px; line-height: normal;\"><span style=\"background-color: rgb(255, 255, 0);\">या </span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px; line-height: normal;\"><span lang=\"EN-US\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px; line-height: normal;\"><span lang=\"EN-US\">Carbendazim 12% + Mancozeb 63% WP (2 g/1 liter of water) <br></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px; line-height: normal;\"><span style=\"background-color: rgb(255, 255, 0);\">या </span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px; line-height: normal;\"><span lang=\"EN-US\">Ridomil Gold (2 g/1 liter of water) </span></p>', '[\"62ce912bf0ea0.jpeg\",\"62ce912bf2e88.jpeg\"]', '62ce912bf3213.jpg', '2022-07-13 15:02:27', '2022-07-13 15:02:44', 4, 4, 1, 1, 7),
(3, '', 'resolved', 117, 'Ashiq', '9761111683', '', 1, '1', '', NULL, 'consultation', '0000-00-00', 2, 5, 'यह बीमारी सभी उम्र के पौधों में पाई जाती है परन्तु सबसे ज्यादा ये बड़े पौधों में देखने को मिलती है |  इस बीमारी को पुरे खेत में फ़ैलाने का काम एफिड (एक प्रकार के छोटे कीट जो पत्तियों और नए अंकुरण से रस चूसते हैं) करते हैं | इसके लक्षण पौधों की नयी पत्तियों  पर दिखने  प्रारंभ होते हैं | पत्तिया आकार में छोटी हो जाती हैं और गहरे-हरे ऊतक के पैच की तरह या छाले की तरह पत्तियों  पर दिखाई देने लगते  हैं, जो पीले - हरे रंग की लामिना  के साथ बारी-बारी से होती हैं | पत्तियों  की लम्बाई  कम हो जाती है और नीचे  से ऊपर की तरफ  मुड़ने लगती हैं | रोग से प्रभावित पौधों का विकास पूरी तरह से बाधित हो जाता है | रोगित पौधों पर फल  टेढ़े मेढ़े एवं विकार युवत तथा सड़ने  लगते हैं फलों का आकार बहुत छोटा रह जाता है |', '<p class=\"MsoNormal\" style=\"font-family: \" source=\"\" sans=\"\" pro\",=\"\" -apple-system,=\"\" blinkmacsystemfont,=\"\" \"segoe=\"\" ui\",=\"\" roboto,=\"\" \"helvetica=\"\" neue\",=\"\" arial,=\"\" sans-serif,=\"\" \"apple=\"\" color=\"\" emoji\",=\"\" ui=\"\" symbol\";=\"\" font-size:=\"\" 12px;\"=\"\"><span lang=\"HI\" arial=\"\" unicode=\"\" ms\",serif;mso-ascii-font-family:=\"\" calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:calibri;=\"\" mso-hansi-theme-font:minor-latin;mso-bidi-font-family:\"arial=\"\" ms\";=\"\" mso-bidi-language:hi\"=\"\" style=\"font-size: 10pt; line-height: 15.3333px;\">खेत को हमेशा साफ सुथरा रखें, प्रभावित पौधों को खेत से निकाल कर नष्ट कर दें | इसके अलावा एफिड्स की संख्या को खेत में फैलने से रोकें एवं उन्हें नियंत्रित करें |</span></p><p class=\"MsoNormal\" style=\"font-family: \" source=\"\" sans=\"\" pro\",=\"\" -apple-system,=\"\" blinkmacsystemfont,=\"\" \"segoe=\"\" ui\",=\"\" roboto,=\"\" \"helvetica=\"\" neue\",=\"\" arial,=\"\" sans-serif,=\"\" \"apple=\"\" color=\"\" emoji\",=\"\" ui=\"\" symbol\";=\"\" font-size:=\"\" 12px;\"=\"\">Acetamiprid 20% SP ( 1 ML/1 Liter of water)&nbsp;<span style=\"font-weight: bolder;\"><span style=\"background-color: rgb(255, 255, 0);\">OR</span>&nbsp;</span><span lang=\"EN-US\" calibri\",sans-serif;mso-ascii-theme-font:minor-latin;=\"\" mso-fareast-font-family:calibri;mso-fareast-theme-font:minor-latin;mso-hansi-theme-font:=\"\" minor-latin;mso-bidi-font-family:mangal;mso-bidi-theme-font:minor-bidi;=\"\" mso-ansi-language:en-us;mso-fareast-language:en-us;mso-bidi-language:ar-sa\"=\"\" style=\"font-size: 11pt; line-height: 16.8667px;\">Imidacloprid 200 SL (17.8 % w/w) (3ml/10 liter of water)&nbsp;&nbsp;<span style=\"font-weight: bolder;\"><span style=\"background-color: rgb(255, 255, 0);\">OR</span>&nbsp;</span></span><span lang=\"EN-US\" calibri\",sans-serif;mso-ascii-theme-font:minor-latin;=\"\" mso-fareast-font-family:calibri;mso-fareast-theme-font:minor-latin;mso-hansi-theme-font:=\"\" minor-latin;mso-bidi-font-family:mangal;mso-bidi-theme-font:minor-bidi;=\"\" mso-ansi-language:en-us;mso-fareast-language:en-us;mso-bidi-language:ar-sa\"=\"\" style=\"font-size: 11pt; line-height: 16.8667px;\">Dimethoate 30 % EC (1gm/1 liter of water)&nbsp;</span><span style=\"font-size: 0.875rem;\"><br></span><span style=\"font-size: 0.875rem;\">Streptomycin Sulfate 90% + Tetracycline Hydrochloride 10% (6 GM/1 Acre)</span></p><p class=\"MsoNormal\" style=\"font-family: \" source=\"\" sans=\"\" pro\",=\"\" -apple-system,=\"\" blinkmacsystemfont,=\"\" \"segoe=\"\" ui\",=\"\" roboto,=\"\" \"helvetica=\"\" neue\",=\"\" arial,=\"\" sans-serif,=\"\" \"apple=\"\" color=\"\" emoji\",=\"\" ui=\"\" symbol\";=\"\" font-size:=\"\" 12px;\"=\"\"><span style=\"font-size: 14px;\">VC-100 antivirus ( 5 gm/ liter )</span></p><p class=\"MsoNormal\" style=\"font-family: \" source=\"\" sans=\"\" pro\",=\"\" -apple-system,=\"\" blinkmacsystemfont,=\"\" \"segoe=\"\" ui\",=\"\" roboto,=\"\" \"helvetica=\"\" neue\",=\"\" arial,=\"\" sans-serif,=\"\" \"apple=\"\" color=\"\" emoji\",=\"\" ui=\"\" symbol\";=\"\" font-size:=\"\" 12px;\"=\"\"><span lang=\"HI\" arial=\"\" unicode=\"\" ms\",se