heme-font:minor-latin;mso-bidi-font-family:=\"\" \"arial=\"\" ms\";mso-ansi-language:en-us;mso-fareast-language:en-us;=\"\" mso-bidi-language:hi\"=\"\" style=\"font-size: 10pt; line-height: 15.3333px;\">&nbsp;से बचाव होता है साथ साथ प्रभावित पौधों में सुधार होता है |</span><span style=\"font-size: 0.875rem;\"><br></span></p><p class=\"MsoNormal\" style=\"font-family: \" source=\"\" sans=\"\" pro\",=\"\" -apple-system,=\"\" blinkmacsystemfont,=\"\" \"segoe=\"\" ui\",=\"\" roboto,=\"\" \"helvetica=\"\" neue\",=\"\" arial,=\"\" sans-serif,=\"\" \"apple=\"\" color=\"\" emoji\",=\"\" ui=\"\" symbol\";=\"\" font-size:=\"\" 12px;\"=\"\">अगर 5-7 स्प्रे के बाद भी वायरस ख़तम ना हो तो इसे स्प्रे करें&nbsp;<br><span style=\"font-size: 0.875rem;\">KURAX (4ml/ 1 liter of water)<br></span><span style=\"font-size: 0.875rem;\">Nimbecidine EC (5 ml/ 1 liter of water)</span></p>', '[\"62e0f9be130b2.png\"]', '62e0f9be1393c.png', '2022-07-13 15:20:12', '2022-07-27 14:09:26', 4, 1, 1, 1, 7),
(4, 'Ticket Title Name', 'open', 117, 'Ashif Ali', '9761111683', '', 1, '1', '', NULL, 'consultation', '2022-07-28', 8, 13, 'नवंबर से लेकर फ़रवरी के मध्य  ठंड के मौसम में पाला पड़ने की समस्या के दौरान,  पपीते में निम्नलिखित समस्याएं होती हैं नए फूल आने बंद हो जाते हैं तथा पुराने फूल झड़ जाते हैं  छोटे छोटे फल जिनकी पकड़ मजबूत नहीं हो पाती वे झड़ जाते हैं  पौधे का विकास रुक जाता है और पौधा सुप्त अवस्था में चला जाता है पत्तियों के किनारे जल जाते हैं और पाला ज्यादा पड़ने की स्थिति में पूरी पत्ती जल जाती है नए अंकुरण आने बंद हो जाते हैं और ऊपर की कोंपल का हिस्सा जल जाता है', '<div style=\"font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 13.3333px;\">पाले से बचाव हेतु कुछ उपाय निम्नलिखित हैं&nbsp;<br><ul><li><span class=\"JsGRdQ\">पाले से बचाव हेतु कुछ उपाय निम्नलिखित हैं ।</span><span class=\"JsGRdQ white-space-prewrap\"></span></li><li><span class=\"JsGRdQ\">पौधों को ऊपर से पॉलिथीन या शेड बना कर कवर कर सकते हैं ताकि ओस की बूंदें सीधे पौधे पर न गिरें।</span><span class=\"JsGRdQ white-space-prewrap\"></span></li><li><span class=\"JsGRdQ\">सल्फर और मैग्नीशियम के कॉमबीनेशन का स्प्रे कर सकते हैं ।</span><span class=\"JsGRdQ white-space-prewrap\"></span></li><li><span class=\"JsGRdQ\">रेगुलर अंतराल पर सादे पानी का स्प्रे कर सकते हैं ।</span><span class=\"JsGRdQ white-space-prewrap\"></span></li><li><span class=\"JsGRdQ\">बहुत हल्की सी छिछली सिंचाई कर सकते हैं ।</span><span class=\"JsGRdQ white-space-prewrap\"></span></li><li><span class=\"JsGRdQ\">फसलों को ठंड से बचाने के लिए शाम के समय खेत में हल्की सिंचाई करे ।</span><span class=\"JsGRdQ white-space-prewrap\"></span></li><li><span class=\"JsGRdQ\">खेत की उत्तर-पश्चिम दिशा में, रात के समय अपशिष्ट पदार्थों/ खरपतवारों और फसल के अवशेषों को जलाकर धुंआ करें ।</span><span class=\"JsGRdQ white-space-prewrap\"></span></li><li><span class=\"JsGRdQ\">फसलों को ठंड से बचाने के लिए सल्फुरिक एसिड @ 0.1% (1 लीटर सल्फुरिक एसिड 1000 लीटर पानी में, Thiourea 500 ppm (500 g thiourea 1000 लीटर</span><span class=\"JsGRdQ white-space-prewrap\">&nbsp;</span><span class=\"JsGRdQ\">पानी</span><span class=\"JsGRdQ white-space-prewrap\">&nbsp;</span><span class=\"JsGRdQ\">में) का स्प्रे करें।</span><span class=\"JsGRdQ white-space-prewrap\"></span></li><li><span class=\"JsGRdQ\">आपके नजदीकी दवा की दुकान पर आपके क्षेत्र में चल रहे पाले से बचाव के लिए स्प्रे जो उपलब्ध हो उसका प्रयोग कर सकते हैं ।</span><span class=\"JsGRdQ white-space-prewrap\"></span></li></ul></div><div style=\"font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 13.3333px;\">ध्यान रखें - इस दौरान फसल में खाद या उर्वरक लगाने का कोई फायदा नहीं होगा इसलिए नवंबर माह के बाद सीधे फ़रवरी मध्य में पपीते की मुख्य उर्वरक की एक डोज अवश्य लगाएं और फिर मैनुअल के हिसाब से उर्वरक और दवाएं लगाते रहें&nbsp;</div>', '[\"62e0fa1bf07e8.png\"]', '62e0fa1bf0d54.png', '2022-07-27 14:10:59', '2022-07-27 14:12:06', 1, 1, 1, 1, 7);
