(1, 'तना गलन / जड़ गलन (Damping-Off )', 'तना गलन / जड़ गलन (Damping-Off )', '', 1, 1, 1, '2022-07-04', '2022-07-04', 1, '[\"62c276e5bf113.jpg\",\"62c276e5bf6fe.png\",\"62c276e5bfe28.png\"]', '<p><br></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px; line-height: normal;\"><span style=\"font-size: 13.3333px;\">पपीते के लिए अच्छी जल निकासी वाली जमीन का चुनाव बहुत जरूरी होता है , इसके अलावा पपीते मे सिंचाई के समय इस बात का पूरा ध्यान रखें की पानी सीधे जड़ या तने के संपर्क मे ना आने पाए बल्कि हल्की सी नमी ही पौधे की जड़ तक पहुच सके सिर्फ उतनी ही सिंचाई करनी चाहिए | नए रोपित पौधे के लिए पहले एक दो सिंचाई पर निम्नलिखित मे से किसी किसी भी एक को उनकी मात्रा के अनुसार स्प्रे एवं drinch करें |</span><br></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px; line-height: normal;\"><span style=\"font-size: 10pt;\"><br></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px; line-height: normal;\"><span style=\"font-size: 10pt;\">निम्नलिखित  फंगीसाइड में से किसी भी एक को स्प्रे या द्रिंच करें और 10 दिन बाद दोहराएं  | </span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px; line-height: normal;\"><br></p><p class=\"MsoNormal\" style=\"margin-