मिलाकर प्रयोग करें<span style=\"font-size: 14px;\"><br></span></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px; line-height: normal;\"><span lang=\"EN-US\"><span style=\"font-size: 14px;\"><br></span></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px; line-height: normal;\"><span lang=\"EN-US\"><span style=\"background-color: rgb(255, 255, 0);\">या </span><span style=\"font-size: 14px;\"><br></span><br>Copper Oxychloride (50% WP) (2  g/1 liter of water)<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px; line-height: normal;\"><span lang=\"EN-US\">Thiophanate Methyl 70% w/w  (2 g/1 liter of water)</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px; line-height: normal;\">दोनों को मिलाकर प्रयोग करें </p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px; line-height: normal;\"><br></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px; line-height: normal;\"><span style=\"background-color: rgb(255, 255, 0);\">या </span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px; line-height: normal;\"><span style=\"background-color: rgb(255, 255, 0);\"><br></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px; line-height: normal;\"><span lang=\"EN-US\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px; line-height: normal;\"><span lang=\"EN-US\">Carbendazim 12% + Mancozeb 63% WP (2 g/1 liter of water) <br></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px; line-height: normal;\"><span style=\"background-color: rgb(255, 255, 0);\"><br></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px; line-height: normal;\"><span style=\"background-color: rgb(255, 255, 0);\">या </span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px; line-height: normal;\"><span style=\"background-color: rgb(255, 255, 0);\"><br></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px; line-height: normal;\"><span lang=\"EN-US\">Ridomil Gold (2 g/1 liter of water) <br><br></span></p>', 'यह बीमारी ज्यादातर छोटे पौधों में देखने को मिलती है खासतौर पर नए रोपित किये हुए पौधों में और नर्सरी में भी ये सामान्य बीमारी है | मिट्टी के ऊपर तने में पिलपिला जैसा पानीयुक्त रिसाव होने लगता है और तने में सडन  शुरू हो जाती है, तना गल जाता है और पौधा गिर कर मर जाता है | यही प्रक्रिया  पौधे में मिट्टी के अंदर  जड़ में भी होती है और ऊपर से पौधा मुरझा कर मर जाता है, जड़ गलन  की शिकायत बड़े पौधों में भी देखने  को मिलती  है | और पौधो मे पत्तिया नीचे से पीली होने लगती है |', 1),
(2, 'ब्लाइट (Blight)', 'ब्लाइट (Blight)', '', 1, 1, 1, '2022-07-04', '2022-07-04', 1, '[\"62c277bfa89d2.png\",\"62c277bfa8f9f.png\",\"62c277bfa96b4.png\"]', '<p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\"><font face=\"Arial Unicode MS, serif\"><span style=\"font-size: 13.3333px;\">चारों सेट मे से किसी भी एक सेट को मिक्स करके सभी पौधों पर स्प्रे करें और एक सप्ताह बाद दोबारा स्प्रे करें ! आवश्यकता पड़ने पर उपचार को एक दो बार और दोहरा सकते हैं !</span></font></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\"><br></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px; line-height: normal;\"><span lang=\"EN-US\">Nativo@75 WG (Bayer Company) 10 ग्राम प्रति टंकी (15 लीटर वाली )</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px; line-height: normal;\"><span lang=\"EN-US\"><span style=\"font-size: 14px;\">Streptomycin Sulfate 90% + Tetracycline Hydrochloride 10% (6 GM/1 Acre)</span></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px; line-height: normal;\"><span lang=\"EN-US\">दोनों को मिलाकर प्रयोग करें</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\"><span lang=\"EN-US\" arial=\"\" unicode=\"\" ms\";mso-bidi-language:=\"\" hi\"=\"\" style=\"line-height: 13.8px;\"><br></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\"><span lang=\"EN-US\" arial=\"\" unicode=\"\" ms\";mso-bidi-language:=\"\" hi\"=\"\" style=\"line-height: 13.8px;\"><span style=\"font-size: 14px; text-align: center; background-color: rgb(255, 255, 0);\">या </span><br></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\"><span lang=\"EN-US\" arial=\"\" unicode=\"\" ms\";mso-bidi-language:=\"\" hi\"=\"\" style=\"line-height: 13.8px;\"><br></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\"><span lang=\"EN-US\" arial=\"\" unicode=\"\" ms\";mso-bidi-language:=\"\" hi\"=\"\" style=\"line-height: 13.8px;\">Thiophanate Methyle 70% WP (2 ml/1 liter of water) <br>Gibbralic Acid 0.001% (1ml/1liter of water)<br><span class=\"JsGRdQ\">{फंगीसाइड पौधे में फंगस को रोकेगा एवं जिबरैलिक ऐसिड पौधे में हुए डैमज की भरपाई करके वापस हरा भरा कर देगा, जिबर