und-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">Carbendazim 50%WP</span><span lang=\"EN-US\" style=\"font-family: Arial, sans-serif; color: rgb(34, 34, 34); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\">) </span><span lang=\"EN-US\" arial=\"\" unicode=\"\" ms\";mso-bidi-language:hi\"=\"\" style=\"line-height: 13.8px;\">(2 g/1 liter of water)<br><br></span></p><p source=\"\" sans=\"\" pro\",=\"\" -apple-system,=\"\" blinkmacsystemfont,=\"\" \"segoe=\"\" ui\",=\"\" roboto,=\"\" \"helvetica=\"\" neue\",=\"\" arial,=\"\" sans-serif,=\"\" \"apple=\"\" color=\"\" emoji\",=\"\" ui=\"\" symbol\";=\"\" font-size:=\"\" 12px;=\"\" font-style:=\"\" normal;=\"\" font-variant-ligatures:=\"\" font-variant-caps:=\"\" font-weight:=\"\" 400;=\"\" letter-spacing:=\"\" orphans:=\"\" 2;=\"\" text-align:=\"\" left;=\"\" text-indent:=\"\" 0px;=\"\" text-transform:=\"\" none;=\"\" white-space:=\"\" widows:=\"\" word-spacing:=\"\" -webkit-text-stroke-width:=\"\" text-decoration-thickness:=\"\" initial;=\"\" text-decoration-style:=\"\" text-decoration-color:=\"\" initial;\"=\"\" style=\"font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\"></p><p source=\"\" sans=\"\" pro\",=\"\" -apple-system,=\"\" blinkmacsystemfont,=\"\" \"segoe=\"\" ui\",=\"\" roboto,=\"\" \"helvetica=\"\" neue\",=\"\" arial,=\"\" sans-serif,=\"\" \"apple=\"\" color=\"\" emoji\",=\"\" ui=\"\" symbol\";=\"\" font-size:=\"\" 12px;=\"\" font-style:=\"\" normal;=\"\" font-variant-ligatures:=\"\" font-variant-caps:=\"\" font-weight:=\"\" 400;=\"\" letter-spacing:=\"\" orphans:=\"\" 2;=\"\" text-align:=\"\" left;=\"\" text-indent:=\"\" 0px;=\"\" text-transform:=\"\" none;=\"\" white-space:=\"\" widows:=\"\" word-spacing:=\"\" -webkit-text-stroke-width:=\"\" text-decoration-thickness:=\"\" initial;=\"\" text-decoration-style:=\"\" text-decoration-color:=\"\" initial;\"=\"\" style=\"font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\"></p><p style=\"font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\"></p><p><span lang=\"HI\" arial=\"\" unicode=\"\" ms\",serif;mso-ascii-font-family:calibri;mso-ascii-theme-font:=\"\" minor-latin;mso-hansi-font-family:calibri;mso-hansi-theme-font:minor-latin;=\"\" mso-bidi-font-family:\"arial=\"\" ms\";mso-bidi-language:hi\"=\"\" style=\"font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 10pt; line-height: 15.3333px;\"><o:p></o:p></span></p><div style=\"font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\"><span style=\"font-size: 0.875rem; text-align: center;\"><span style=\"background-color: rgb(255, 255, 0);\">या <br><br></span></span><span class=\"JsGRdQ\">Apple cited vinegar @6ml/ltr water</span></div>', 'यह रोग पौधरोपण के शुरुआती दिनों में ज्यादातर देखने को मिलता है, पौधे के पास मिट्टी में ज्यादा नमी, या ज्यादा पानी लग जाने के कारण, या मिट्टी में नमी के साथ तापमान में गर्मी होने की वजह से यह रोग देखने को मिलता है ।  ज्यादातर मामलों में रेतीली/भूड़  मिट्टी में ज्यादा पानी लग जाने के कारण यह रोग प्रकट होता है ।    \r\n\r\nयह रोग पत्तियों को गंभीर नुकसान पहुंचाता है। पत्तियों पर सफेद चकत्ते पड़ने लगते हैं, पत्तियों के किनारे सूखने लगते हैं और पूरी पत्ती पर फैल जाते हैं, पूरी पत्ती सूख जाती है और फिर गिर जाती है, नए अंकुरण जल जाते हैं और पौधे का विकास रुक जाता है, इस रोग का एक लक्षण यह भी है की पपीते के तने पर से सारी पत्तियां झड जाती हैं और कई बार तने पर सफ़ेद धब्बे पड़ जाते हैं ऐसा लगता है तना सूख रहा है, कई बार तने का एक हिस्सा पिचक जाता है और पौधा कमजोर होकर मर जाता है |', 1),
(3, 'फूट रॉट - Foot Rot', 'फूट रॉट - Foot Rot', '', 1, 1, 1, '2022-07-04', '2022-07-04', 1, '[\"62c278a60ab99.png\",\"62c278a60b263.png\",\"62c278a60ba08.png\",\"62c278a60c37c.png\"]', '<p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px; line-height: normal;\">यदि किसी पौधे पर इस रोग के लक्षण दिखाई दें तो तने के प्रभावित क्षेत्र को हल्का सा खरोंच कर उसपर Copper Oxychloride or Bordeaux (बोर्डो मिश्रण) का लेप लगायें | बोर्डो मिश्रण को बनाने के लिए कोपर सल्फेट (नीला थोथा), चूना और पानी को 1 : 1 :10 के अनुपात में अलग अलग घोल लें (1 किग्रा नीला थोथा और 10 लीटर पानी एक बर्तन में, और दूसरे बर्तन में 1 किग्रा चूना एवं 10 लीटर पानी दूसरे बर्तन में), अच्छे से घुलने के बाद दोनों मिश्रण को एक साथ मिला कर तब तक फेंटे जब तक की एक गाढ़ा घोल न तैयार हो जाये, इस गाढे घोल का प्रयोग लेप के रूप में करें।<br></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px; line-height: normal;\"><span class=\"JsGRdQ\"><br>लेप के पश्चात पौधे की जड़ के पास <br><br>Copper Oxychloride 50% WP (3g/litre)<br></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px; line-height: normal;\"><span class=\"JsGRdQ\"><br><span style=\"background-color: rgb(255, 255, 0);\">या</span> <br></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px; line-height: normal;\"><span lang=\"EN-US\"><br></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px; line-height: normal;\"><span lang=\"EN-US\">Nativo@75 WG (Bayer Company) 10 ग्राम प्रति टंकी (15 लीटर वाली )</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px; line-height: normal;\"><span lang=\"EN-US\"><span style=\"font-size: 14px;\">Streptomycin Sulfate 90% + Tetracycline Hydrochloride 10% (6 GM/1 Acre)</span></span></p><p class=\"MsoNormal\" style=\"font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\"><span class=\"JsGRdQ\" yadk4jhqbpg=\"\" 0\",=\"\" _fb_,=\"\" auto;=\"\" font-size:=\"\" 13.3197px;\"=\"\"></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px; line-height: normal;\"><span lang=\"EN-US\">दोनों को मिलाकर प्रयोग करें</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px; line-height: normal;\"><br></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px; line-height: normal;\"><br></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px; line-height: normal;\"><span class=\"JsGRdQ\">का घोल बना कर द्रिंच भी करें।</span><span class=\"JsGRdQ white-space-prewrap\"> </span><span class=\"JsGRdQ\">फलन के समय Copper Oxychloride 50% WP or Mancozeb 63% WP की यह द्रिन्चिंग पपीते में एक निश्चित अंतराल (15-20 दिन ) पर एक बार अवश्य करें ।</span></p>', 'पपीते में यह बीमारी काफी बड़ी मात्रा में पाई जाती है, पपीता ज्यादा नमी को लेकर बहुत ज्यादा संवेदनशील होता है, वयस्क पौधे इस रोग से ज्यादा प्रभावित होते हैं, तने में मिट्टी के पास, या थोड़े ऊपर, अथवा मिट्टी के अंदर जड़ों में ज्यादा नमी की वजह से तने में सड़न प्रारंभ हो जाती है, तने में स्थित रेशे सड़ने लगते हैं और फिर पौधे में जड़ों से लेकर ऊपर तक की संचार प्रक्रिया बाधित हो जाती है और पौधा मुरझा कर मर जाता है।  प्रारंभ में रोग का आक्रमण हल्का होता है, जो बाद में तेजी बढ़ता है। यदि मिट्टी के पास या ऊपर का तना प्रभावित होता है तो यह आसानी से पहचान में आ जाता है और पौधे के बचने की संभावना बढ़ जाती है लेकिन यदि यह सड़न मिट्टी के अंदर जड़ में होती है तो जब तक संचार प्रक्रिया बाधित नहीं होती तब तक रोग का पता नहीं चल पाता, इस दशा में पौधे को बचाना बहुत मुश्किल हो जाता है। इसलिए सिंचाई के दौरान एवं बरसात के मौसम में नमी का विशेष ध्यान रखने की आवश्यकता होती है ।', 1),
