2</span><span lang=\"EN-US\"> g/litre of water)</span></p><p class=\"MsoNormal\" style=\"font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\"><span lang=\"EN-US\"></span></p><p class=\"_04xlpA direction-ltr align-justify para-style-body\" yadk4jhqbpg=\"\" 0\",=\"\" _fb_,=\"\" auto;=\"\" font-size:=\"\" 13.3197px;=\"\" line-height:=\"\" 1.4;\"=\"\" style=\"font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\"><span class=\"JsGRdQ\">इनमे से किसी भी एक का 15-20 दिन के अन्तराल पर लगातार स्प्रे करते रहने से इस रोग में बचाव होता है।</span></p>', 'यह रोग हरे अपरिपक्व फलों पर ज्यादा दिखाई देता है, रोग लगने के बाद ऐसा लगता है की फल पकने से पहले ही सड रहा है ! फलों पर हल्के धब्बे पड़ते हैं, फिर उनमे फंगस जैसा दिखाई पड़ता है, धब्बो में सडन होती है और पानी के साथ हलकी पिलपिलाहट होती है, धब्बे पहले तो  भूरे होते हैं फिर काले  पड़ते हैं और बाद  में गुलाबी रंग में बदल जाते हैं, जब कवक  बीजाणु पैदा करते हैं तो धब्बे के नीचे का पल्प  नरम और पानीदार  हो जाता है और पुरे फल में  फेलने लगता  है, कई बार यही धब्बे पत्तियों  पर भी देखे गये  हैं, प्रारंभिक दौर  में ये स्पष्ट नहीं होते परन्तु बाद  में फलों  की सतह पर भूरे धब्बेदार धब्बे  विकसित होते हैं, जो बाद  में पानी से भीगे घावों  को बढ़ाते हैं। प्रभावित हिस्से के नीचे का पल्प  नरम हो जाता है और सड़ने लगता है। पहले  तो यह धीरे-धीरे परन्तु कुछ दिनों बाद यह सारे फलों पर बहुत तेजी से फैलता  है और सारे फल सड़ जाते हैं |', 1),
(5, 'मोजेक वायरस - Mosaic Virus', 'मोजेक वायरस - Mosaic Virus', '', 1, 2, 1, '2022-07-04', '2022-07-04', 1, '[\"62c27a0f73de8.png\",\"62c27a0f743de.png\",\"62c27a0f74f64.png\",\"62c27a0f75781.png\"]', '<p class=\"MsoNormal\" style=\"font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\"><span lang=\"HI\" arial=\"\" unicode=\"\" ms\",serif;mso-ascii-font-family:=\"\" calibri;mso-ascii-theme-font:minor-latin;mso-hansi-font-family:calibri;=\"\" mso-hansi-theme-font:minor-latin;mso-bidi-font-family:\"arial=\"\" ms\";=\"\" mso-bidi-language:hi\"=\"\" style=\"font-size: 10pt; line-height: 15.3333px;\">खेत को हमेशा साफ सुथरा रखें, प्रभावित पौधों को खेत से निकाल कर नष्ट कर दें | इसके अलावा एफिड्स की संख्या को खेत में फैलने से रोकें एवं उन्हें नियंत्रित करें |</span></p><p class=\"MsoNormal\" style=\"font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\">Acetamiprid 20% SP ( 1 ML/1 Liter of water) <span style=\"font-weight: bolder;\"><span style=\"background-color: rgb(255, 255, 0);\">OR</span> </span><span lang=\"EN-US\" calibri\",sans-serif;mso-ascii-theme-font:minor-latin;=\"\" mso-fareast-font-family:calibri;mso-fareast-theme-font:minor-latin;mso-hansi-theme-font:=\"\" minor-latin;mso-bidi-font-family:mangal;mso-bidi-theme-font:minor-bidi;=\"\" mso-ansi-language:en-us;mso-fareast-language:en-us;mso-bidi-language:ar-sa\"=\"\" style=\"font-size: 11pt; line-height: 16.8667px;\">Imidacloprid 200 SL (17.8 % w/w) (3ml/10 liter of water)  <span style=\"font-weight: bolder;\"><span style=\"background-color: rgb(255, 255, 0);\">OR</span> </span></span><span lang=\"EN-US\" calibri\",sans-serif;mso-ascii-theme-font:minor-latin;=\"\" mso-fareast-font-family:calibri;mso-fareast-theme-font:minor-latin;mso-hansi-theme-font:=\"\" minor-latin;mso-bidi-font-family:mangal;mso-bidi-theme-font:minor-bidi;=\"\" mso-ansi-language:en-us;mso-fareast-language:en-us;mso-bidi-language:ar-sa\"=\"\" style=\"font-size: 11pt; line-height: 16.8667px;\">Dimethoate 30 % EC (1gm/1 liter of water) </span><span style=\"font-size: 0.875rem;\"><br></span><span style=\"font-size: 0.875rem;\">Streptomycin Sulfate 90% + Tetracycline Hydrochloride 10% (6 GM/1 Acre)</span></p><p class=\"MsoNormal\" style=\"font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\"><span style=\"font-size: 14px;\">VC-100 antivirus ( 5 gm/ liter )</span></p><p class=\"MsoNormal\" style=\"font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\"><span lang=\"HI\" arial=\"\" unicode=\"\" ms\",serif;mso-ascii-font-family:=\"\" calibri;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:calibri;=\"\" mso-fareast-theme-font:minor-latin;mso-hansi-font-family:calibri;mso-hansi-theme-font:=\"\" minor-latin;mso-bidi-font-family:\"arial=\"\" ms\";mso-ansi-language:en-us;=\"\" mso-fareast-language:en-us;mso-bidi-language:hi\"=\"\" style=\"font-size: 10pt; line-height: 15.3333px;\">उपरोक्त दवाओं का</span><span lang=\"EN-US\" calibri\",sans-serif;=\"\" mso-ascii-theme-font:minor-latin;mso-fareast-font-family:calibri;mso-fareast-theme-font:=\"\" minor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:mangal;=\"\" mso-bidi-theme-font:minor-bidi;mso-ansi-language:en-us;mso-fareast-language:=\"\" en-us;mso-bidi-language:ar-sa\"=\"\" style=\"font-size: 11pt; line-height: 16.8667px;\"> सप्ताह मे एक बार </span><span lang=\"HI\" arial=\"\" unicode=\"\" ms\",serif;=\"\" mso-ascii-font-family:calibri;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:=\"\" calibri;mso-fareast-theme-font:minor-latin;mso-hansi-font-family:calibri;=\"\" mso-hansi-theme-font:minor-latin;mso-bidi-font-family:\"arial=\"\" ms\";=\"\" mso-ansi-language:en-us;mso-fareast-language:en-us;mso-bidi-language:hi\"=\"\" style=\"font-size: 10pt; line-height: 15.3333px;\">के अन्तराल पर लगातार स्प्रे करते रहने से </span><span lang=\"EN-US\" calibri\",sans-serif;=\"\" mso-ascii-theme-font:minor-latin;mso-fareast-font-family:calibri;mso-fareast-theme-font:=\"\" minor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:\"arial=\"\" unicode=\"\" ms\";=\"\" mso-ansi-language:en-us;mso-fareast-language:en-us;mso-bidi-language:hi\"=\"\" style=\"font-size: 11pt; line-height: 16.8667px;\">Aphids ,Whitefly तथा अन्य कई चूसने वाले कीटों </span><span lang=\"HI\" arial=\"\" unicode=\"\" ms\",serif;mso-ascii-font-family:calibri;mso-ascii-theme-font:=\"\" minor-latin;mso-fareast-font-family:calibri;mso-fareast-theme-font:minor-latin;=\"\" mso-hansi-font-family:calibri;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:=\"\" \"arial=\"\" ms\";mso-ansi-language:en-us;mso-fareast-language:en-us;=\"\" mso-bidi-language:hi\"=\"\" style=\"font-size: 10pt; line-height: 15.3333px;\"> से बचाव होता है साथ साथ प्रभावित पौधों में सुधार होता है |</span><span style=\"font-size: 0.875rem;\"><br></span></p><p class=\"MsoNormal\" style=\"font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\">अगर 5-7 स्प्रे के बाद भी वायरस ख़तम ना हो तो इसे स्प्रे करें <br><span style=\"font-size: 0.875rem;\">KURAX (4ml/ 1 liter of water)<br></span><span style=\"font-size: 0.875rem;\">Nimbecidine EC (5 ml/ 1 liter of water)</span></p>', 'यह बीमारी सभी उम्र के पौधों में पाई जाती है परन्तु सबसे ज्यादा ये बड़े पौधों में देखने को मिलती है |  इस बीमारी को पुरे खेत में फ़ैलाने का काम एफिड (एक प्रकार के छोटे कीट जो पत्तियों और नए अंकुरण से रस चूसते हैं) करते हैं | इसके लक्षण पौधों की नयी पत्तियों  पर दिखने  प्रारंभ होते हैं | पत्तिया आकार में छोटी हो जाती हैं और गहरे-हरे ऊतक के पैच की तरह या छाले की तरह पत्तियों  पर दिखाई देने लगते  हैं, जो पीले - हरे रंग की लामिना  के साथ बारी-बारी से होती हैं | पत्तियों  की लम्बाई  कम हो जाती है और नीचे  से ऊपर की तरफ  मुड़ने लगती हैं | रोग से प्रभावित पौधों का विकास पूरी तरह से बाधित हो जाता है | रोगित पौधों पर फल  टेढ़े मेढ़े एवं विकार युवत तथा सड़ने  लगते हैं फलों का आकार बहुत छोटा रह जाता है |', 1),
