"\" rgb(255,=\"\" 255,=\"\" 0);\"=\"\"><span style=\"background-color: rgb(255, 255, 0);\"><span style=\"font-weight: bolder;\">OR </span></span> </span><font face=\"Calibri, sans-serif\"><span style=\"font-size: 11pt;\">Metasystox 25% EC (0.02%) (2 ml/ 1 liter of water) (एफ़िड, व्हाइटफ्लाइ, मच्छर या रस चूसने वाले कीटों के लिए)</span></font></span><br></li><li style=\"line-height: 2;\"><span lang=\"EN-US\" style=\"text-indent: -18pt; line-height: 13.8px;\"><span style=\"font-size: 0.875rem;\">Ethion 50 % EC (2 ml/1liter of water) </span><span style=\"text-indent: 0px; font-weight: bolder;\"><span style=\"font-size: 0.875rem; background-color: rgb(255, 255, 0);\">OR</span><span style=\"font-size: 0.875rem;\"> </span><span style=\"font-size: 14.6667px;\"> </span></span><span style=\"font-size: 0.875rem;\"> </span></span><span lang=\"EN-US\" style=\"text-indent: -18pt; font-size: 10pt; line-height: 15.3333px; font-family: Mangal, serif;\">या</span><span lang=\"EN-US\" style=\"text-indent: -18pt; font-size: 10pt; line-height: 15.3333px;\"> </span><span lang=\"EN-US\" style=\"text-indent: -18pt; font-size: 10pt; line-height: 15.3333px; font-family: Mangal, serif;\">कोई</span><span lang=\"EN-US\" style=\"text-indent: -18pt; font-size: 10pt; line-height: 15.3333px;\"> </span><span lang=\"EN-US\" style=\"text-indent: -18pt; font-size: 10pt; line-height: 15.3333px; font-family: Mangal, serif;\">भी</span><span lang=\"EN-US\" style=\"text-indent: -18pt; font-size: 10pt; line-height: 15.3333px;\"> </span><span lang=\"EN-US\" style=\"text-indent: -18pt; font-size: 10pt; line-height: 15.3333px; font-family: Mangal, serif;\">बढ़िया</span><span lang=\"EN-US\" style=\"text-indent: -18pt; font-size: 10pt; line-height: 15.3333px;\"> </span><span lang=\"EN-US\" style=\"text-indent: -18pt; font-size: 10pt; line-height: 15.3333px; font-family: Mangal, serif;\">मकड़ीनाशक</span><span lang=\"EN-US\" style=\"text-indent: -18pt; font-size: 10pt; line-height: 15.3333px;\"> </span><span lang=\"EN-US\" style=\"text-indent: -18pt; font-size: 10pt; line-height: 15.3333px; font-family: Mangal, serif;\">जो</span><span lang=\"EN-US\" style=\"text-indent: -18pt; font-size: 10pt; line-height: 15.3333px;\"> </span><span lang=\"EN-US\" style=\"text-indent: -18pt; font-size: 10pt; line-height: 15.3333px; font-family: Mangal, serif;\">आपके</span><span lang=\"EN-US\" style=\"text-indent: -18pt; font-size: 10pt; line-height: 15.3333px;\"> </span><span lang=\"EN-US\" style=\"text-indent: -18pt; font-size: 10pt; line-height: 15.3333px; font-family: Mangal, serif;\">क्षेत्र</span><span lang=\"EN-US\" style=\"text-indent: -18pt; font-size: 10pt; line-height: 15.3333px;\"> </span><span lang=\"EN-US\" style=\"text-indent: -18pt; font-size: 10pt; line-height: 15.3333px; font-family: Mangal, serif;\">में</span><span lang=\"EN-US\" style=\"text-indent: -18pt; font-size: 10pt; line-height: 15.3333px;\"> </span><span lang=\"EN-US\" style=\"text-indent: -18pt; font-size: 10pt; line-height: 15.3333px; font-family: Mangal, serif;\">उपलब्ध</span><span lang=\"EN-US\" style=\"text-indent: -18pt; font-size: 10pt; line-height: 15.3333px;\"> </span><span lang=\"EN-US\" style=\"text-indent: -18pt; font-size: 10pt; line-height: 15.3333px; font-family: Mangal, serif;\">हो</span></li><li style=\"line-height: 2;\"><span style=\"font-size: 0.875rem;\">Streptomycin Sulfate 90% + Tetracycline Hydrochloride 10% (6 GM/1 Acre) (एंटीबायोटिक )</span></li><li style=\"line-height: 2;\"><span style=\"font-size: 14px;\">VC-100 antivirus ( 5 gm/ liter ) (Product of Berrysun Agro Science Pvt Ltd, Delhi) (कर्ल लीफ एंटी वायरस ) </span></li></ol><p class=\"MsoNormal\" style=\"font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px; line-height: 2;\"><span class=\"JsGRdQ\">सामान्यतः  इन पांचों को मिलाकर 10 - 15 दिन के अन्तराल पर लगातार स्प्रे करते रहने से मकड़ी और White Fly से बचाव होता है तथा इनकी संख्या नियंत्रित करने में काफी सहायता मिलती है।</span></p><p class=\"MsoNormal\" style=\"font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\">परंतु यदि वायरस आ गया हो फसल में तो फिर इसे 5-7 दिन के अंतराल पर दोहराएं, 5 से 6 स्प्रे में भी यदि असर न दिखे तो तत्काल ही अपने जनपद के उद्यान विभाग के पपीते के कृषि वैज्ञानिक को संपर्क करें और उचित उपचार करें  । </p><div><br></div>', 'यह रोग मकड़ियों के द्वारा पत्तियों से रस चूस लेने के कारण फैलता है और फिर मकड़ियां और सफ़ेद मक्खियां इन्हे पूरे खेत में तेजी से फैलाती हैं | पत्तियों में बहुत ज्यादा मुडाव, ऐंठन, सिकुडन और विकृति इस रोग के लक्षण हैं | सबसे ज्यादा नयी और विकसित पत्तियां  प्रभावित होती हैं पत्तियों में मुडाव , सिकुडन या विकृति  के अलावा  ये पत्तियों की नसों का सफेद  या पीला  पड़ जाना और उनका सामान्य से ज्यादा  मोटा होना भी इसके लक्षण हैं | कई बार तो पत्तिया  पूरी तरह से मुड जाती हैं | प्रभावित पौधों का विकास पूरी तरह से बाधित हो जाता है और यदि फल  लगते  हैं तो फलों का आकार विकृत होता है |', 1);
