(7, 'रिंग स्पॉट वायरस - Ring Spot Virus', 'रिंग स्पॉट वायरस - Ring Spot Virus', '', 1, 2, 1, '2022-07-04', '2022-07-04', 1, '[\"62c27af0bcf96.png\",\"62c27af0bd8a8.png\",\"62c27af0be286.png\"]', '<p class=\"MsoNormal\" style=\"font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\"><span style=\"font-size: 13.3333px;\"><span style=\"font-weight: bolder;\">लक्षण - </span></span><span yadk4jhqbpg=\"\" 0\",=\"\" _fb_,=\"\" auto;=\"\" font-size:=\"\" 13.3197px;\"=\"\">पपीते में फसल की सभी अवस्थाओं में संक्रमण का खतरा होता है। पत्तियों पर गहरे पीले और हरे रंग के मोज़ेक पैटर्न विकसित होते हैं। पत्तियाँ छोटी हो जाती हैं और किनारे और बाहर के हिस्से नीचे और अंदर की ओर मुड़ जाते हैं जिसके परिणामस्वरूप भयंकर तरीके से ऐंठ जाती हैं और छत्ता बन जाता है ।</span></p><p class=\"_04xlpA direction-ltr align-justify para-style-body\" yadk4jhqbpg=\"\" 0\",=\"\" _fb_,=\"\" auto;=\"\" font-size:=\"\" 13.3197px;=\"\" line-height:=\"\" 1.4;\"=\"\" style=\"font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\"><span class=\"JsGRdQ\">प्रभावित पौधे बौने हो जाते हैं और जल्दी संक्रमण से फल नहीं बनते हैं, फूल बनते ही सूख जाते हैं और बने हुए छोटे छोटे फल ऐंठ जाते हैं और टेढ़े मेढ़े आकार लेने लगते हैं ।</span><span class=\"JsGRdQ white-space-prewrap\"> </span><span class=\"JsGRdQ\">यह रोग फलों के स्वाद और रंग पर भी प्रतिकूल प्रभाव डालता है।<br><br><span style=\"font-weight: bolder;\">रोग प्रबंधन - </span><br></span></p><p class=\"_04xlpA direction-ltr align-justify para-style-body\" yadk4jhqbpg=\"\" 0\",=\"\" _fb_,=\"\" auto;=\"\" font-size:=\"\" 13.3197px;=\"\" line-height:=\"\" 1.4;\"=\"\" style=\"font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\"><span class=\"JsGRdQ\">अब तक जो उपलब्ध तरीके हैं</span><span class=\"JsGRdQ white-space-prewrap\"></span></p><ul style=\"font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\"><li><span class=\"JsGRdQ\">संक्रमित पौधों को खेत से निकाल कर नष्ट कर देना</span><span class=\"JsGRdQ white-space-prewrap\"></span></li><li><span class=\"JsGRdQ\">क्रॉस प्रोटेक्शन</span><span class=\"JsGRdQ white-space-prewrap\"></span></li><li><span class=\"JsGRdQ\">एफ़िडस नियंत्रण इत्यादि,</span><span class=\"JsGRdQ white-space-prewrap\"> </span><span class=\"JsGRdQ\">इन तरीकों को अपना कर इस वायरस के नुकसान को कम किया जा सकता है ।</span><span class=\"JsGRdQ white-space-prewrap\"></span></li></ul><p class=\"_04xlpA direction-ltr align-justify para-style-body\" yadk4jhqbpg=\"\" 0\",=\"\" _fb_,=\"\" auto;=\"\" font-size:=\"\" 13.3197px;=\"\" line-height:=\"\" 1.4;\"=\"\" style=\"font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\"></p><p class=\"_04xlpA direction-ltr align-justify para-style-body\" yadk4jhqbpg=\"\" 0\",=\"\" _fb_,=\"\" auto;=\"\" font-size:=\"\" 13.3197px;=\"\" line-height:=\"\" 1.4;\"=\"\" style=\"font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\"><span class=\"JsGRdQ\">यदि लक्षण दिखाई देने लगे तो इसका मतलब एफ़िडस के छिड़काव के लिए पहले से ही देर हो चुकी है। सबसे अधिक संभावना होती है कि पास के स्वस्थ पौधों में संक्रमण पहुँच गया हो। हालांकि प्रतिरोधी किस्में निश्चित उत्तर हैं, परंतु दुर्भाग्य से वे अभी तक भारत में उपलब्ध नहीं हैं।</span></p><p class=\"_04xlpA direction-ltr align-justify para-style-body\" yadk4jhqbpg=\"\" 0\",=\"\" _fb_,=\"\" auto;=\"\" font-size:=\"\" 13.3197px;=\"\" line-height:=\"\" 1.4;\"=\"\" style=\"font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\"><span class=\"JsGRdQ\">फिर भी दो एंटी वायरस उत्पाद हैं जो काफी हद तक इस वायरस के नियंत्रण में कारगर हैं, हालांकि इनकी भी कोई गारंटी नहीं है फिर भी आंध्र प्रदेश और कर्नाटक के पपीते के किसानों को इन उत्पादों से काफी हद तक इस वायरस के नियंत्रण में सहायता प्राप्त हुई है ।</span></p><ul style=\"font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\"><li><span class=\"JsGRdQ\">VC-100 antivirus. <br></span></li><li><span class=\"JsGRdQ\">Velvet (Ajinkya chemtech pvt ltd द्वारा निर्मित )</span></li></ul><p class=\"_04xlpA direction-ltr align-justify para-style-body\" yadk4jhqbpg=\"\" 0\",=\"\" _fb_,=\"\" auto;=\"\" font-size:=\"\" 13.3197px;=\"\" line-height:=\"\" 1.4;\"=\"\" style=\"font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\"></p><p class=\"_04xlpA direction-ltr align-justify para-style-body\" yadk4jhqbpg=\"\" 0\",=\"\" _fb_,=\"\" auto;=\"\" font-size:=\"\" 13.3197px;=\"\" line-height:=\"\" 1.4;\"=\"\" style=\"font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\"><span class=\"JsGRdQ\"></span><span class=\"JsGRdQ white-space-prewrap\"></span></p><p class=\"_04xlpA direction-ltr align-justify para-style-body\" yadk4jhqbpg=\"\" 0\",=\"\" _fb_,=\"\" auto;=\"\" font-size:=\"\" 13.3197px;=\"\" line-height:=\"\" 1.4;\"=\"\" style=\"font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\"><span class=\"JsGRdQ\">ये दोनों उत्पाद मार्केट में आसानी से उपलब्ध हैं, और इन्हे ऑनलाइन भी मंगाया जा सकता है, कुछ दूरस्थ किसानों को यदि यह नहीं मिल पाता तो कंपनी किसान की रीक्वेस्ट पर इन्हे मार्केट से खरीद कर डाक द्वारा भिजवा देती है।<br><br><span style=\"font-weight: bolder;\">उपचार - <br></span></span></p><p class=\"_04xlpA direction-ltr align-justify para-style-body\" yadk4jhqbpg=\"\" 0\",=\"\" _fb_,=\"\" auto;=\"\" font-size:=\"\" 13.3197px;=\"\" line-height:=\"\" 1.4;\"=\"\" style=\"font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\"><span class=\"JsGRdQ\">पौधरोपण के पश्चात् प्रत्येक 15 दिन पर निम्नलिखित को मिक्स करके पूरे पौधे पर स्प्रे करें, जब पौधे पर फूल आने शुरू हो जाएँ तो इसका प्रयोग महीने में एक बार या आवश्यकता अनुसार करें ।</span><span class=\"JsGRdQ white-space-prewrap\"></span></p><p class=\"_04xlpA direction-ltr align-justify para-style-body\" yadk4jhqbpg=\"\" 0\",=\"\" _fb_,=\"\" auto;=\"\" font-size:=\"\" 13.3197px;=\"\" line-height:=\"\" 1.4;\"=\"\" style=\"font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\"></p><ul style=\"font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\"><li><span class=\"JsGRdQ\">Acetamiprid 20% SP ( 1 ML/1 Liter of water) (एफ़िड्स एवं व्हाइट फ्लाइ के नियंत्रण के लिए)</span></li><li><span class=\"JsGRdQ\">Streptomycin Sulfate 90% + Tetracycline Hydrochloride 10% (6 GM/1 Acre) (एंटीबायोटिक)</span></li><li><span class=\"JsGRdQ\">VC-100 antivirus ( 5 gm/ liter )<br></span></li><li><span class=\"JsGRdQ\">Ajinkya’s Velvet (5ml/per liter)</span></li><li>इस रोग का लक्षण दिखने के बाद उपचार मुश्किल हो जाता है इसलिए अपने बगीचे की निगरानी लगातार करते रहें । उपरोक्त दवाओं का प्रयोग निरंतर करने के बाद भी यदि इस रोग के लक्षण दिखने लगें तो तत्काल ही अपने जनपद के उद्यान विभाग के पपीते से संबंधित कृषि वैज्ञानिक से संपर्क करें एवं उनके द्वारा बताए गए निर्देशों का पालन करें ।</li></ul>', 'पपीते में जितने भी प्रकार के रोग या वायरस लगते हैं उन सभी में रिंग स्पॉट वायरस (PRSV) सबसे ज्यादा विनाशकारी है । एफिड्स और व्हाइट फ्लाइ द्वारा मुख्य रूप से फैलने वाले इस वायरस में महामारी की तरह बीमारियाँ पैदा करने की क्षमता होती है। यह पपीते के पूरे बगीचे को बर्बाद कर देता है । इस वायरस के अटैक के बाद बगीचा इस कदर बर्बाद होता है कि पपीते की प्रजाति तक पहचान करने में दिक्कत होती है । ऐसा लगता है बगीचे में रेड लेडी न होके कोई अन्य मिक्स प्रजाति खेत में लगी हुई है ।', 1),
(8, 'नींबू की तितली /सूँडी - Leaf Miner / Citrus Butterfly / Caterpiller', 'नींबू की तितली /सूँडी - Leaf Miner / Citrus Butterfly / Caterpiller', '', 2, 3, 1, '2022-07-04', '2022-07-04', 1, '[\"62c27b86c03b1.jpg\",\"62c27b86c0a07.jpg\",\"62c27b86c18ac.jpg\",\"62c27b86c2616.jpg\",\"62c27b86c2e50.jpg\"]', '<p>निम्नलिखित में से किसी भी एक कीटनाशक को उसके निर्धारित डोज के साथ स्प्रे  करने से इस रोग मे काफी राहत मिलती है !<br></p><p></p><div>Emamectin benzoate 5 % SG (डोज : 4 ग्राम प्रति 10 लीटर पानी) के साथ छिड़काव  <br></div><div><span style=\"background-color: rgb(255, 255, 0);\"><span style=\"font-weight: bolder;\"><u>या </u></span></span><br></div><div><span style=\"font-size: 0.875rem;\">Imidacloprid 17.8 SL (</span><span style=\"font-size: 0.875rem;\">इमिडाक्लोप्रीड (17.8 </span><span style=\"font-size: 0.875rem;\">एस एल )(</span><span style=\"font-size: 0.875rem;\">डोज :</span><span style=\"font-size: 0.875rem;\"> </span><span style=\"font-size: 0.875rem;\"> 0.5 मिली लीटर प्रति लीटर पानी) के साथ छिड़काव <br></span><span style=\"font-weight: bolder; background-color: rgb(255, 255, 0);\"><u>या </u></span><span style=\"font-size: 0.875rem;\"><br></span><span style=\"font-size: 0.875rem;\">Quinalphos 25 % EC (क़्यूनॉलफॉस 25 इ.सी.)  (</span><span style=\"font-size: 0.875rem;\">डोज :</span><span style=\"font-size: 0.875rem;\"> </span><span style=\"font-size: 0.875rem;\">1.25 मिली लीटर प्रति लीटर पानी ) <br></span><u style=\"font-weight: 700; background-color: rgb(255, 255, 0);\">या </u><span style=\"font-size: 0.875rem;\"><br>Acephate 75 % SP </span><span style=\"color: rgb(51, 51, 51); font-family: Calibri, CalibriRegular; background-color: rgb(248, 247, 235);\">(</span><span style=\"font-size: 0.875rem;\">एसीफेट 75 </span>एस<span style=\"font-size: 0.875rem;\"> पी)  (</span><span style=\"font-size: 0.875rem;\">डोज :</span><span style=\"font-size: 0.875rem;\"> </span><span style=\"font-size: 0.875rem;\">0.8 ग्राम प्रति लीटर पानी) <br></span><u style=\"font-weight: 700; background-color: rgb(255, 255, 0);\">या </u><span style=\"font-size: 0.875rem;\"><br></span><span style=\"font-size: 0.875rem;\">Dimethoate 30% EC (डाईमिथोएट 30 ई. सी.) (</span><span style=\"font-size: 0.875rem;\">डोज :</span><span style=\"font-size: 0.875rem;\"> </span><span style=\"font-size: 0.875rem;\">2 मिली लीटर प्रति लीटर पानी) के साथ पत्तियों के नीचे दो बार 15 दिनों के अन्तराल में छिड़काव <br></span><u style=\"font-weight: 700; background-color: rgb(255, 255, 0);\">या <br></u><span style=\"font-size: 0.875rem;\">नीम तेल ३ मिली लीटर प्रति लीटर का छिड़काव भी काफी हद तक इसकी रोकथाम में सहायक होता है।</span></div><div><br style=\"font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 13.3333px;\"></div>', 'यह हरे , भूरे या काले सफेद रंग का कीड़ा होता है जिसके ऊपर छोटे छोटे रोयें होते हैं, ये पत्तियां खाते है और इसके लार्वा पत्तियों मे ऐंठन पैदा कर देते हैं , नए अंकुरण पर इनका अटैक ज्यादा रहता है ! पौधे का विकास रुक जाता है और पौधा सूख कर मर जाता है !', 1),
(9, 'चिटी, मकोड़ा, लाल छोटी मकड़ी का आतंक', 'चिटी, मकोड़ा, लाल छोटी मकड़ी का आतंक', '', 1, 3, 1, '2022-07-04', '2022-07-04', 1, '[\"62c27c0bc6bc0.jpg\",\"62c27c0bc721f.jpg\",\"62c27c0bcb437.jpg\"]', '<p>निम्नलिखित को स्प्रे करने से  चिटी, मकोड़ा,  लाल छोटी मकड़ी  से छुटकारा मिलता है और पौधे का विकास पुनः प्रारंभ हो जाता है </p><p>CHLORPYRIFOS 50%+CYPERMETHRIN 5%EC</p><p>0.5 ml/ Ltr of Water.</p>', 'ये पौधे पर जाल बना कर पौधे का विकास रोक देती है   ये पत्तियों  के नीचे छुप जाती है तथा आसानी से दिखाई नहीं देती है तथा पत्तिया छतरी के आकार मे नीचे के और मूड जाती है | नए अंकुरण का विकास भी प्रभावित होता है |', 1),
