12% + Mancozeb 63% WP (2 g/1 liter of water) <br></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px; line-height: normal;\"><span style=\"background-color: rgb(255, 255, 0);\">या </span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px; line-height: normal;\"><span lang=\"EN-US\">Ridomil Gold (2 g/1 liter of water) </span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px; line-height: normal;\"><span lang=\"EN-US\"><br></span><span style=\"font-weight: bolder; font-size: 0.875rem; background-color: rgb(255, 255, 0);\"><u>खेत मे वायरस लगा हुआ है </u></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px; line-height: normal;\">निम्नलिखित दवाओं को मिलाकर सप्ताह मे एक बार स्प्रे करें तथा जब तक वायरस ठीक न हो जाए इसे दोहराते रहें , <span style=\"font-size: 13.3333px;\">साथ ही साथ </span><span style=\"font-weight: bolder; font-size: 13.3333px;\">Planofix</span><span style=\"font-size: 13.3333px;\">  (1 मिली / 3 लीटर पानी मे) तथा </span><span style=\"font-weight: bolder; font-size: 13.3333px;\">Boran 20</span><span style=\"font-size: 13.3333px;\"> (2 ग्राम प्रति लीटर पानी मे ) घोल कर स्प्रे करें </span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px; line-height: normal;\">Acetamiprid 20% SP ( 1 ML/1 Liter of water) <span style=\"font-weight: bolder;\"><span style=\"background-color: rgb(255, 255, 0);\">OR</span> </span><span lang=\"EN-US\" calibri\",sans-serif;mso-ascii-theme-font:minor-latin;=\"\" mso-fareast-font-family:calibri;mso-fareast-theme-font:minor-latin;mso-hansi-theme-font:=\"\" minor-latin;mso-bidi-font-family:mangal;mso-bidi-theme-font:minor-bidi;=\"\" mso-ansi-language:en-us;mso-fareast-language:en-us;mso-bidi-language:ar-sa\"=\"\" style=\"font-size: 11pt; line-height: 16.8667px;\">Imidacloprid 200 SL (17.8 % w/w) (3ml/10 liter of water)  <span style=\"font-weight: bolder;\"><span style=\"background-color: rgb(255, 255, 0);\">OR</span> </span></span><span lang=\"EN-US\" calibri\",sans-serif;mso-ascii-theme-font:minor-latin;=\"\" mso-fareast-font-family:calibri;mso-fareast-theme-font:minor-latin;mso-hansi-theme-font:=\"\" minor-latin;mso-bidi-font-family:mangal;mso-bidi-theme-font:minor-bidi;=\"\" mso-ansi-language:en-us;mso-fareast-language:en-us;mso-bidi-language:ar-sa\"=\"\" style=\"font-size: 11pt; line-height: 16.8667px;\">Dimethoate 30 % EC (1gm/1 liter of water) </span><span style=\"font-size: 0.875rem;\"><br></span><span style=\"font-size: 0.875rem;\">Streptomycin Sulfate 90% + Tetracycline Hydrochloride 10% (6 GM/1 Acre)<br></span><span style=\"font-size: 0.875rem;\"> Velvet (5ml/per liter)</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px; line-height: normal;\"><span style=\"font-size: 0.875rem;\"><br></span><span style=\"font-weight: bolder; font-size: 0.875rem; background-color: rgb(255, 255, 0);\"><u>पौधे को ठीक से पोषण नहीं मिल रहा है , खाद उर्वरक की सप्लाइ ठीक से नहीं हो रही है </u></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px; line-height: normal;\">मैनुअल मे बताए हुए खाद की डोज को पौधों की संख्या के अनुसार अप्लाइ करें तथा <span style=\"font-size: 13.3333px;\">साथ ही साथ </span><span style=\"font-size: 13.3333px;\">Planofix</span><span style=\"font-size: 13.3333px;\">  (1 मिली / 3 लीटर पानी मे) तथा </span><span style=\"font-size: 13.3333px;\">Boran 20</span><span style=\"font-size: 13.3333px;\"> (2 ग्राम प्रति लीटर पानी मे ) घोल कर स्प्रे करें </span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px; line-height: normal;\"><span style=\"font-size: 13.3333px;\"><br></span><span style=\"font-weight: bolder; font-size: 0.875rem; background-color: rgb(255, 255, 0);\"><u>सब कुछ ठीक है फिर भी फूल झड़ रहे हैं </u></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px; line-height: normal;\"><span style=\"font-size: 13.3333px;\">Planofix</span><span style=\"font-size: 13.3333px;\">  (1 मिली / 3 लीटर पानी मे) तथा </span><span style=\"font-size: 13.3333px;\">Boran 20</span><span style=\"font-size: 13.3333px;\"> (2 ग्राम प्रति लीटर पानी मे ) घोल कर स्प्रे करें </span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px; line-height: normal;\"><span style=\"font-size: 13.3333px;\"><br></span><span style=\"font-weight: bolder; font-size: 0.875rem; background-color: rgb(255, 255, 0);\">रस चूसने वाले कीट लगे हुए हैं जैसे - मच्छर, मक्खी इत्यादि   </span></p><p style=\"font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\">जो भी कीट लगा हुआ है उसको नियंत्रित करने के लिए उपयुक्त कीटनाशक का स्प्रे करें तथा साथ ही साथ <span style=\"font-size: 13.3333px;\">Planofix</span><span style=\"font-size: 13.3333px;\">  (1 मिली / 3 लीटर पानी मे) तथा </span><span style=\"font-size: 13.3333px;\">Boran 20</span><span style=\"font-size: 13.3333px;\"> (2 ग्राम प्रति लीटर पानी मे ) घोल कर स्प्रे करें </span></p>', 'पपीते में फल या फूल झड़ने की समस्या के मुख्य कारण निम्नलिखित हैं \r\nयदि फसल मे फंगस लगी हुई है  - पिछली सिंचाई मे ज्यादा पानी लग गया था या बारिश ज्यादा हो गई थी , या  बारिश की वजह से खेत मे जरूरत से ज्यादा नमी हो गई थी |\r\nखेत मे वायरस फैला हुआ है  \r\nपौधे को ठीक से पोषण नहीं मिल रहा है , खाद उर्वरक की सप्लाइ पर्याप्त रूप से नहीं की जा रही है \r\nरस चूसने वाले कीट लगे हुए हैं, जैसे मच्छर, मक्खी, मकड़ी इत्यादि', 1),
(11, 'मीलीबग Mealybugs', 'मीलीबग Mealybugs', '', 1, 5, 1, '2022-07-04', '2022-07-04', 1, '[\"62c27d213deef.jpg\",\"62c27d213e8aa.jpg\",\"62c27d213f06c.jpg\",\"62c27d213f914.jpg\"]', '<p class=\"_04xlpA direction-ltr align-justify para-style-body\" yadk4jhqbpg=\"\" 0\",=\"\" _fb_,=\"\" auto;=\"\" font-size:=\"\" 13.3197px;=\"\" line-height:=\"\" 1.4;\"=\"\" style=\"font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\"><span class=\"JsGRdQ\">डिटर्जेंट (कपड़े ढोने वाला वाशिंग पाउडर) को पानी में घोल कर पौधे पर स्प्रे करें ताकि वैक्स की परत हट जाए, तत्पश्चात निम्नलिखित कीटनाशक में से किसी एक को स्प्रे करें ।</span><span class=\"JsGRdQ white-space-prewrap\"></span></p><p class=\"_04xlpA direction-ltr align-justify para-style-body\" yadk4jhqbpg=\"\" 0\",=\"\" _fb_,=\"\" auto;=\"\" font-size:=\"\" 13.3197px;=\"\" line-height:=\"\" 1.4;\"=\"\" style=\"font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\"></p><p class=\"_04xlpA direction-ltr align-justify para-style-body\" yadk4jhqbpg=\"\" 0\",=\"\" _fb_,=\"\" auto;=\"\" font-size:=\"\" 13.3197px;=\"\" line-height:=\"\" 1.4;\"=\"\" style=\"font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\"><span class=\"JsGRdQ\">Acephate 75 % SP (2ml/Liter)<span style=\"background-color: rgb(255, 255, 0);\"><span style=\"font-weight: bolder;\">अथवा</span></span></span></p><p class=\"_04xlpA direction-ltr align-justify para-style-body\" yadk4jhqbpg=\"\" 0\",=\"\" _fb_,=\"\" auto;=\"\" font-size:=\"\" 13.3197px;=\"\" line-height:=\"\" 1.4;\"=\"\" style=\"font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\"><span class=\"JsGRdQ\">profenophos 50 EC (2 ml/litre)<span style=\"background-color: rgb(255, 255, 0);\"><span style=\"font-weight: bolder;\">अथवा</span></span></span><span class=\"JsGRdQ white-space-prewrap\"></span></p><p class=\"_04xlpA direction-ltr align-justify para-style-body\" yadk4jhqbpg=\"\" 0\",=\"\" _fb_,=\"\" auto;=\"\" font-size:=\"\" 13.3197px;=\"\" line-height:=\"\" 1.4;\"=\"\" style=\"font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\"><span class=\"JsGRdQ\">chlorpyriphos 20 EC (2ml/litre)<span style=\"background-color: rgb(255, 255, 0);\"><span style=\"font-weight: bolder;\">अथवा</span></span></span><span class=\"JsGRdQ white-space-prewrap\"></span></p><p class=\"_04xlpA direction-ltr align-justify para-style-body\" yadk4jhqbpg=\"\" 0\",=\"\" _fb_,=\"\" auto;=\"\" font-size:=\"\" 13.3197px;=\"\" line-height:=\"\" 1.4;\"=\"\" style=\"font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\"><span class=\"JsGRdQ\">buprofezin 25 EC (2 ml/litre)<span style=\"background-color: rgb(255, 255, 0);\"><span style=\"font-weight: bolder;\">अथवा</span></span></span><span class=\"JsGRdQ white-space-prewrap\"></span></p><p class=\"_04xlpA direction-ltr align-justify para-style-body\" yadk4jhqbpg=\"\" 0\",=\"\" _fb_,=\"\" auto;=\"\" font-size:=\"\" 13.3197px;=\"\" line-height:=\"\" 1.4;\"=\"\" style=\"font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\"><span class=\"JsGRdQ\">dimethoate 30 EC (2 ml/litre)<span style=\"background-color: rgb(255, 255, 0);\"><span style=\"font-weight: bolder;\">अथवा</span></span></span><span class=\"JsGRdQ white-space-prewrap\"></span></p><p class=\"_04xlpA direction-ltr align-justify para-style-body\" yadk4jhqbpg=\"\" 0\",=\"\" _fb_,=\"\" auto;=\"\" font-size:=\"\" 13.3197px;=\"\" line-height:=\"\" 1.4;\"=\"\" style=\"font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\"><span class=\"JsGRdQ\">thiomethoxam 25 WG (0.6 g/ litre)<span style=\"background-color: rgb(255, 255, 0);\"><span style=\"font-weight: bolder;\">अथवा</span></span></span><span class=\"JsGRdQ white-space-prewrap\"></span></p><p class=\"_04xlpA direction-ltr align-justify para-style-body\" yadk4jhqbpg=\"\" 0\",=\"\" _fb_,=\"\" auto;=\"\" font-size:=\"\" 13.3197px;=\"\" line-height:=\"\" 1.4;\"=\"\" style=\"font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\"><span class=\"JsGRdQ\">imidacloprid 17.8 SL (0.6 ml/<span style=\"background-color: rgb(255, 255, 0);\"><span style=\"font-weight: bolder;\">litre</span></span>)</span></p>', 'यह छोटे छोटे, अंडाकार, मुलायम शरीर वाले, रस चूसक रुई के समान कीट हैं। वयस्क मीली बग पत्तियों, तनों एवं जड़ों को सफेद मोम पाउडर जैसे पदार्थ  से ढक लेता है। यह अपने चूसने एवं चुभोने वाले मुखांगों की सहायता से पत्तियों एवं तनों से अधिक मात्रा में रस चूसकर पौधों को आवश्यक पोषक तत्वों से वंचित कर देता है । यह कीट अतिरिक्त रस को मधुरस जैसे चिपचिपे पदार्थ के रूप में मलत्याग के द्वारा बाहर निकालता है जो चींटियों को आकर्षित करता है ।  यह मधुरस काले फफूंद को विकसित करने मे भी सहायता करता है जिससे पौधे की प्रकाश संश्लेषण क्रिया पर विपरीत प्रभाव पड़ता है । पत्तियां सिकुड़ कर मुड़ जाती हैं एवं पौधा पीला पड़कर सूखने लगता है, प्रभावित पौधों में उत्पादन बहुत कम होता है और फल बेचने योग्य नहीं रहते ।', 1),
(12, 'मकड़ी Spider', 'मकड़ी Spider', '', 1, 5, 1, '2022-07-04', '2022-07-04', 1, '[\"62c27da3dd5a8.jpg\",\"62c27da3ddd1f.jpg\",\"62c27da3de4eb.jpg\",\"62c27da3dec7b.jpg\",\"62c27da3df405.jpg\"]', '<p style=\"font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\">निम्नलिखित मे से किसी भी एक को स्प्रे करने से  मकड़ी  से छुटकारा मिलता है और पौधे का विकास पुनः प्रारंभ हो जाता है </p><p style=\"font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\">Dimethoate 30 % EC (1gm/1 liter of water) <span style=\"font-weight: bolder; background-color: rgb(255, 255, 0);\"> या </span></p><p style=\"font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\">Ethion 50 % EC (2 ml/1liter of water)  <span style=\"font-weight: bolder; background-color: rgb(255, 255, 0);\">या </span></p><p style=\"font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\">Omite (Propargite 57% EC) (0.5 ml / 1 liter of water) या</p><p style=\"font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\">कोई भी बहिया मकड़ीनाशक जो आपके क्षेत्र में उपलब्ध हो | </p>', 'ये पौधे पर जाल बना कर पौधे का विकास रोक देती है   ये पत्तियों  के नीचे छुप जाती है तथा आसानी से दिखाई नहीं देती है तथा पत्तिया छतरी के आकार मे नीचे के और मूड जाती है | नए अंकुरण का विकास भी प्रभावित होता है |', 1),
(13, 'पाला पड़ने एवं तापमान कम होने की समस्या', 'पाला पड़ने एवं तापमान कम होने की समस्या', '', 1, 8, 1, '2022-07-04', '2022-07-07', 1, '[\"62c27e1bc00e3.jpg\",\"62c27e1bc073b.jpg\",\"62c27e1bc1005.jpg\",\"62c27e1bc19f4.jpg\"]', '<div style=\"font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 13.3333px;\">पाले से बचाव हेतु कुछ उपाय निम्नलिखित हैं&nbsp;<br><ul><li><span class=\"JsGRdQ\">पाले से बचाव हेतु कुछ उपाय निम्नलिखित हैं ।</span><span class=\"JsGRdQ white-space-prewrap\"></span></li><li><span class=\"JsGRdQ\">पौधों को ऊपर से पॉलिथीन या शेड बना कर कवर कर सकते हैं ताकि ओस की बूंदें सीधे पौधे पर न गिरें।</span><span class=\"JsGRdQ white-space-prewrap\"></span></li><li><span class=\"JsGRdQ\">सल्फर और मैग्नीशियम के कॉमबीनेशन का स्प्रे कर सकते हैं ।</span><span class=\"JsGRdQ white-space-prewrap\"></span></li><li><span class=\"JsGRdQ\">रेगुलर अंतराल पर सादे पानी का स्प्रे कर सकते हैं ।</span><span class=\"JsGRdQ white-space-prewrap\"></span></li><li><span class=\"JsGRdQ\">बहुत हल्की सी छिछली सिंचाई कर सकते हैं ।</span><span class=\"JsGRdQ white-space-prewrap\"></span></li><li><span class=\"JsGRdQ\">फसलों को ठंड से बचाने के लिए शाम के समय खेत में हल्की सिंचाई करे ।</span><span class=\"JsGRdQ white-space-prewrap\"></span></li><li><span class=\"JsGRdQ\">खेत की उत्तर-पश्चिम दिशा में, रात के समय अपशिष्ट पदार्थों/ खरपतवारों और फसल के अवशेषों को जलाकर धुंआ करें ।</span><span class=\"JsGRdQ white-space-prewrap\"></span></li><li><span class=\"JsGRdQ\">फसलों को ठंड से बचाने के लिए सल्फुरिक एसिड @ 0.1% (1 लीटर सल्फुरिक एसिड 1000 लीटर पानी में, Thiourea 500 ppm (500 g thiourea 1000 लीटर</span><span class=\"JsGRdQ white-space-prewrap\">&nbsp;</span><span class=\"JsGRdQ\">पानी</span><span class=\"JsGRdQ white-space-prewrap\">&nbsp;</span><span class=\"JsGRdQ\">में) का स्प्रे करें।</span><span class=\"JsGRdQ white-space-prewrap\"></span></li><li><span class=\"JsGRdQ\">आपके नजदीकी दवा की दुकान पर आपके क्षेत्र में चल रहे पाले से बचाव के लिए स्प्रे जो उपलब्ध हो उसका प्रयोग कर सकते हैं ।</span><span class=\"JsGRdQ white-space-prewrap\"></span></li></ul></div><div style=\"font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 13.3333px;\">ध्यान रखें - इस दौरान फसल में खाद या उर्वरक लगाने का कोई फायदा नहीं होगा इसलिए नवंबर माह के बाद सीधे फ़रवरी मध्य में पपीते की मुख्य उर्वरक की एक डोज अवश्य लगाएं और फिर मैनुअल के हिसाब से उर्वरक और दवाएं लगाते रहें&nbsp;</div>', 'नवंबर से लेकर फ़रवरी के मध्य  ठंड के मौसम में पाला पड़ने की समस्या के दौरान,  पपीते में निम्नलिखित समस्याएं होती हैं नए फूल आने बंद हो जाते हैं तथा पुराने फूल झड़ जाते हैं  छोटे छोटे फल जिनकी पकड़ मजबूत नहीं हो पाती वे झड़ जाते हैं  पौधे का विकास रुक जाता है और पौधा सुप्त अवस्था में चला जाता है पत्तियों के किनारे जल जाते हैं और पाला ज्यादा पड़ने की स्थिति में पूरी पत्ती जल जाती है नए अंकुरण आने बंद हो जाते हैं और ऊपर की कोंपल का हिस्सा जल जाता है', 4),
(14, 'जंगली सुवर का आतंक (Wild Boar)', 'जंगली सुवर का आतंक (Wild Boar)', '', 1, 9, 1, '2022-07-04', '2022-07-04', 1, '[\"62c27e815fee4.jpg\"]', '<p class=\"_04xlpA direction-ltr align-justify para-style-body\" yadk4jhqbpg=\"\" 0\",=\"\" _fb_,=\"\" auto;=\"\" font-size:=\"\" 13.3197px;=\"\" line-height:=\"\" 1.4;\"=\"\" style=\"font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\"><span class=\"JsGRdQ\">इनसे बचाव हेतु निम्नलिखित उपाय किए जा सकते हैं</span><span class=\"JsGRdQ white-space-prewrap\"></span></p><ul style=\"font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\"><li><span class=\"JsGRdQ\">खेत के चारों तरफ बाड़ या कँटीलें तार से तार बंदी करा सकते हैं ।</span><span class=\"JsGRdQ white-space-prewrap\"></span></li><li><span class=\"JsGRdQ\">सोलर फेंसिंग (झटका मशीन वाली तार बंदी) भी करवा सकते हैं ।</span><span class=\"JsGRdQ white-space-prewrap\"></span></li><li><span class=\"JsGRdQ\">खेत में जगह-जगह निम्नलिखित दवाओं में से किसी एक को खेत के चारों तरफ कुछ जगहों पर रख सकते हैं ताकि इसकी गंध पूरे खेत में फैल जाए , इसकी गंध से जानवर खेत में नहीं आएंगे ।</span><span class=\"JsGRdQ white-space-prewrap\"></span><ul><li><span class=\"JsGRdQ\">FORATE - फोरेट 10 ग्राम प्रति किलोग्राम मिट्टी मे</span><span class=\"JsGRdQ white-space-prewrap\"></span></li><li><span class=\"JsGRdQ\">FURADON - फ्यूराडान 5 ग्राम प्रति किलोग्राम मिट्टी में</span><span class=\"JsGRdQ white-space-prewrap\"></span></li><li><span class=\"JsGRdQ\">PHENYL - फिनाईल 100 मिली 1 किलोग्राम मिट्टी में</span><span class=\"JsGRdQ white-space-prewrap\"></span></li></ul></li><li><span class=\"JsGRdQ\">रखवाली के लिए कुत्तों को भी खेत पर रख सकते हैं ।</span></li></ul>', 'जंगली सुवर झुंड में आते हैं और खेत में पौधे की जड़ के पास की मिट्टी को अपने नुथनों  से खोद देते हैं , जिससे पौधा जड़ सहित उखड़ जाता है, जंगली सुवर झुंड मे होने के नाते बड़े पैमाने पर खेत में नुकसान पहुँचाते हैं !', 1),
(15, 'खरगोश का आतंक (Wild Rabits)', 'खरगोश का आतंक (Wild Rabits)', '', 1, 9, 1, '2022-07-04', '2022-07-04', 1, '[\"62c27eca3f464.jpg\"]', '<p class=\"_04xlpA direction-ltr align-justify para-style-body\" yadk4jhqbpg=\"\" 0\",=\"\" _fb_,=\"\" auto;=\"\" font-size:=\"\" 13.3197px;=\"\" line-height:=\"\" 1.4;\"=\"\" style=\"font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\"><span class=\"JsGRdQ\">इनसे बचाव हेतु निम्नलिखित उपाय किए जा सकते हैं</span><span class=\"JsGRdQ white-space-prewrap\"></span></p><ul style=\"font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\"><li><span class=\"JsGRdQ\">खेत के चारों तरफ बाड़ या कँटीलें तार से तार बंदी करा सकते हैं ।</span><span class=\"JsGRdQ white-space-prewrap\"></span></li><li><span class=\"JsGRdQ\">सोलर फेंसिंग (झटका मशीन वाली तार बंदी) भी करवा सकते हैं ।</span><span class=\"JsGRdQ white-space-prewrap\"></span></li><li><span class=\"JsGRdQ\">खेत में जगह-जगह निम्नलिखित दवाओं में से किसी एक को खेत के चारों तरफ कुछ जगहों पर रख सकते हैं ताकि इसकी गंध पूरे खेत में फैल जाए , इसकी गंध से जानवर खेत में नहीं आएंगे ।</span><span class=\"JsGRdQ white-space-prewrap\"></span><ul><li><span class=\"JsGRdQ\">FORATE - फोरेट 10 ग्राम प्रति किलोग्राम मिट्टी मे</span><span class=\"JsGRdQ white-space-prewrap\"></span></li><li><span class=\"JsGRdQ\">FURADON - फ्यूराडान 5 ग्राम प्रति किलोग्राम मिट्टी में</span><span class=\"JsGRdQ white-space-prewrap\"></span></li><li><span class=\"JsGRdQ\">PHENYL - फिनाईल 100 मिली 1 किलोग्राम मिट्टी में</span><span class=\"JsGRdQ white-space-prewrap\"></span></li></ul></li><li><span class=\"JsGRdQ\">रखवाली के लिए कुत्तों को भी खेत पर रख सकते हैं ।</span></li></ul>', 'खरगोश छोटे पौधों को तने सहित खा जाते हैं, हालांकि पपीते का पौधा स्वाद में थोड़ा कड़वा होता है लेकिन फिर भी खरगोश भारी मात्रा में नुकसान पहुचाते हैं, वे जड़ के पास से तने को काट देते हैं और पौधा कटकर गिर जाता है', 1),
(16, 'सेही का आतंक (Wild Porcupine )', 'सेही का आतंक (Wild Porcupine )', '', 1, 9, 1, '2022-07-04', '2022-07-04', 1, '[\"62c27efeea072.jpg\"]', '<p class=\"_04xlpA direction-ltr align-justify para-style-body\" yadk4jhqbpg=\"\" 0\",=\"\" _fb_,=\"\" auto;=\"\" font-size:=\"\" 13.3197px;=\"\" line-height:=\"\" 1.4;\"=\"\" style=\"font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\"><span class=\"JsGRdQ\">इनसे बचाव हेतु निम्नलिखित उपाय किए जा सकते हैं</span><span class=\"JsGRdQ white-space-prewrap\"></span></p><ul style=\"font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\"><li><span class=\"JsGRdQ\">खेत के चारों तरफ बाड़ या कँटीलें तार से तार बंदी करा सकते हैं ।</span><span class=\"JsGRdQ white-space-prewrap\"></span></li><li><span class=\"JsGRdQ\">सोलर फेंसिंग (झटका मशीन वाली तार बंदी) भी करवा सकते हैं ।</span><span class=\"JsGRdQ white-space-prewrap\"></span></li><li><span class=\"JsGRdQ\">खेत में जगह-जगह निम्नलिखित दवाओं में से किसी एक को खेत के चारों तरफ कुछ जगहों पर रख सकते हैं ताकि इसकी गंध पूरे खेत में फैल जाए , इसकी गंध से जानवर खेत में नहीं आएंगे ।</span><span class=\"JsGRdQ white-space-prewrap\"></span><ul><li><span class=\"JsGRdQ\">FORATE - फोरेट 10 ग्राम प्रति किलोग्राम मिट्टी मे</span><span class=\"JsGRdQ white-space-prewrap\"></span></li><li><span class=\"JsGRdQ\">FURADON - फ्यूराडान 5 ग्राम प्रति किलोग्राम मिट्टी में</span><span class=\"JsGRdQ white-space-prewrap\"></span></li><li><span class=\"JsGRdQ\">PHENYL - फिनाईल 100 मिली 1 किलोग्राम मिट्टी में</span><span class=\"JsGRdQ white-space-prewrap\"></span></li></ul></li><li><span class=\"JsGRdQ\">रखवाली के लिए कुत्तों को भी खेत पर रख सकते हैं ।</span></li></ul>', 'सेही छोटे पौधों को तने सहित खा जाते हैं, कई बार ये पौधों को जड़ के पास से खोद कर उखाड़ भी देते हैं', 1),
(17, 'नीलगाय या सांड का आतंक', 'नीलगाय या सांड का आतंक', '', 1, 9, 1, '2022-07-04', '2022-07-04', 1, '[\"62c27f47878aa.jpg\",\"62c27f4788241.jpg\"]', '<p style=\"font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\">इनसे बचाव हेतु निम्नलिखित उपाय किए जा सकते हैं </p><ol style=\"font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\"><li>खेत के चारों तरफ बाड़ या कँटीलें तार से तार बंदी करा सकते हैं</li><li>खेत की बाउंड्री या चारदीवारी भी करा सकते हैं </li><li>झटका मशीन वाली भी तार बंदी करवा सकते हैं </li><li>रखवाली के लिए कुत्तों को भी खेत पर रख सकते हैं </li></ol>', 'नीलगाय या सांड पपीते के पौधों को खाते तो नहीं लेकिन झुंड मे होने के नाते जब वे खेत को दौड़ कर पार करते हैं तो पपीते के पौधे टूट जाते हैं , पूरा खेत उजड़ जाता है', 1),
