y: &quot;Source Sans Pro&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 12px; line-height: normal;\"></p><p class=\"MsoListParagraphCxSpLast\" style=\"margin: 0cm 0cm 0cm 18pt; font-family: &quot;Source Sans Pro&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 12px; text-align: justify; text-indent: -18pt; line-height: normal;\"><span style=\"font-size: 10pt; font-family: Wingdings; color: rgb(0, 112, 192);\">ü<span times=\"\" new=\"\" roman\";\"=\"\" style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal;\">&nbsp;&nbsp;</span></span><span mangal\",serif;=\"\" color:#0070c0;mso-ansi-language:en-in;mso-bidi-language:hi\"=\"\" style=\"font-size: 10pt;\">12 Gram : Streptocycline</span></p>', 'पौधे  की पॉलीथीन में जितनी मिटटी है, खुरपी की मदद से उतना गड्ढा बेड पर खोदें, पौधे की पॉलीथीन हटाएँ, और गड्ढे में रोपित करें और पौधे के चारो तरफ लगभग एक फिट की थाल बना दें, और पानी लगा दें, ताकि खेत की खुली हुई मिटटी और पौधे की बंधी हुई मिटटी आपस में बंध जाये और जड़ों का विकास खेत में हो सके !', NULL),
(35, 'ब्लैक स्पॉट ( Black Spot )', 'ब्लैक स्पॉट ( Black Spot )', '', 1, 1, 1, '2022-07-06', '2022-07-06', 1, '[\"62c56fb0439c0.jpg\",\"62c56fb043d4c.jpg\"]', '<p style=\"font-family: &quot;Source Sans Pro&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 12px;\"><span arial=\"\" unicode=\"\" ms\",=\"\" serif;=\"\" font-size:=\"\" 13.3333px;\"=\"\">तीनों सेट मे से किसी भी एक सेट की&nbsp; करे सभी पौधों व फलों पर स्प्रे करें और एक सप्ताह बाद दोबारा स्प्रे करें ! आवश्यकता पड़ने पर उपचार को एक दो बार और दोहरा सकते हैं !<br></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: &quot;Source Sans Pro&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 12px; line-height: normal;\"><span lang=\"EN-US\">Nativo@75 WG (Bayer Company) 10 ग्राम प्रति टंकी (15 लीटर वाली )</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: &quot;Source Sans Pro&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 12px; line-height: normal;\"><span lang=\"EN-US\"><span style=\"font-size: 14px;\">Streptomycin Sulfate 90% + Tetracycline Hydrochloride 10% (6 GM/1 Acre)</span></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: &quot;Source Sans Pro&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 12px; line-height: normal;\"><span lang=\"EN-US\">दोनों को मिलाकर प्रयोग करें</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: &quot;Source Sans Pro&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 12px; line-height: normal;\"><br></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: &quot;Source Sans Pro&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 12px; line-height: normal;\"><span style=\"background-color: rgb(255, 255, 0);\">OR</span></p><p style=\"font-family: &quot;Source Sans Pro&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 12px;\"><span arial=\"\" unicode=\"\" ms\",=\"\" serif;=\"\" font-size:=\"\" 13.3333px;\"=\"\"><br></span>Copper Oxychloride 50% WP(2 / 1 liter of water)<br><br><span style=\"font-weight: bolder; background-color: rgb(255, 255, 0);\">OR<br></span><br>Thiophanate Methyle 70% WP (2 gm/ 1 liter of water)<br><br><span style=\"background-color: rgb(255, 255, 0); font-weight: bolder;\">OR</span><br><br>Carbendazim 12% + Mencozeb 63% ( 2gm/1 liter of water )<br></p>', 'पीले रंग के मार्जिन के साथ ऊपर हल्के भूरे रंग के होते हैं; नीचे, बीजाणु विकसित होकर धब्बों को गहरे भूरे या काले रंग में बदल देते हैं यदि पत्तियां गंभीर रूप से संक्रमित हो जाती हैं तो वे भूरे रंग की हो जाती हैं और मर जाती हैं। फलों पर धब्बे भूरे से काले और थोड़े धँसे हो जाते है', NULL),
(36, 'आयरन एवम् पोटैशियम संबंधित समस्या (Iron and Potassium Deficiency)', 'आयरन एवम् पोटैशियम संबंधित समस्या (Iron and Potassium Deficiency)', '', 1, 12, 1, '2022-07-06', '2022-07-06', 1, '[\"62c57037ccff9.jpg\",\"62c57037cd1d3.jpg\"]', '<p><span style=\"font-family: &quot;Source Sans Pro&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 12px;\">मैनुअल मे दिया हुआ मुख्य उर्वरक लगवाइए&nbsp;</span><br></p>', 'पौधे का विकास रुक जाता है | पत्ते किनारे से  पीले होने लगते है | और धीरे -धीरे पूरा पत्ता पीला हो जाता है |', NULL),
