(38, 'जड़ों मे फंगस का लगना Root fungus', 'जड़ों मे फंगस का लगना Root fungus', '', 1, 1, 1, '2022-07-07', '2022-07-07', 4, '[\"62c6793d6a0b5.jpg\",\"62c6793d6a578.jpg\",\"62c6793d6a8c7.jpg\"]', '<p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: &quot;Source Sans Pro&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 12px; line-height: normal;\"><span style=\"font-size: 13.3333px;\">पपीते के लिए अच्छी जल निकासी वाली जमीन का चुनाव बहुत जरूरी होता है , इसके अलावा पपीते मे सिंचाई के समय इस बात का पूरा ध्यान रखें की पानी सीधे जड़ या तने के संपर्क मे ना आने पाए बल्कि हल्की सी नमी ही पौधे की जड़ तक पहुच सके सिर्फ उतनी ही सिंचाई करनी चाहिए |&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: &quot;Source Sans Pro&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 12px; line-height: normal;\"><span style=\"font-size: 10pt;\">निम्नलिखित&nbsp; फंगीसाइड में से किसी भी एक को स्प्रे या द्रिंच करें और 10 दिन बाद दोहराएं&nbsp; |&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: &quot;Source Sans Pro&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 12px; line-height: normal;\"><span lang=\"EN-US\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-family: &quot;Source Sans Pro&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 12px