(39, 'पौडरी  मिल्डयू  (Powdery Mildew )', 'पौडरी  मिल्डयू  (Powdery Mildew )', '', 1, 1, 1, '2022-07-07', '2022-07-07', 4, '[\"62c679f048569.jpg\",\"62c679f048683.jpg\",\"62c679f048717.jpg\",\"62c679f04a5f7.jpg\",\"62c679f04a6a2.jpg\"]', '<p class=\"_04xlpA direction-ltr align-justify para-style-body\" yadk4jhqbpg=\"\" 0\",=\"\" _fb_,=\"\" auto;=\"\" font-size:=\"\" 13.3197px;=\"\" line-height:=\"\" 1.4;\"=\"\" style=\"font-family: &quot;Source Sans Pro&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 12px;\"><span class=\"JsGRdQ\">जैसे ही रोग के लक्षण दिखाई दें निम्नलिखित में से किसी एक को रोग ठीक होने तक प्रत्येक 15 दिन पर स्प्रे करें</span><span class=\"JsGRdQ white-space-prewrap\"></span></p><ul style=\"font-family: &quot;Source Sans Pro&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;; font-size: 12px;\"><li><span class=\"JsGRdQ\">CONTAF PLUS (5% SC formulation of Hexaconazole) (2 ml/ 1 liter of water)&nbsp;<span style=\"background-color: rgb(255, 255, 0);\"><span style=\"font-weight: bolder;\">अथवा</span></span></span><span class=\"JsGRdQ white-space-prewrap\"></span></li><li><span class=\"JsGRdQ\">SYSTHANE (Myclobutanil 10.3% WP) (1 ml/ 1 liter of water)<span style=\"background-color: rgb(255, 255, 0);\"><span style=\"font-weight: bolder;\">अथवा</span></span></span></li><li><span class=\"JsGRdQ\">Ergon 44.3 % SC</span><span class=\"JsGRdQ white-space-prewrap\">&nbsp;</span><span class=\"JsGRdQ\">( Kresoxim Methyl ) (1 ml/ 1 liter of water)&nbsp;<span style=\"background-color: rgb(255, 255, 0);\"><span style=\"font-weight: bolder;\">अथवा</span></span></span><span class=\"JsGRdQ white-space-prewrap\"></span></li><li><span class=\"JsGRdQ\">Dusting Sulphur (30 g/10 litres of water)&nbsp;<span style=\"background-color: rgb(255, 255, 0);\"><span style=\"font-weight: bolder;\">अथवा</span></span></span><span class=\"JsGRdQ white-space-prewrap\"></span></li><li><span class=\"JsGRdQ\">Calixin 75 EC (5 ml/10 litres of water)&nbsp;<span style=\"background-color: rgb(255, 255, 0);\"><span style=\"font-weight: bolder;\">अथवा</span></span></span></li><li><span class=\"JsGRdQ\"><span style=\"background-color: rgb(255, 255, 0);\"><span style=\"font-weight: bolder;\"><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-weight: 400; line-height: normal;\"><span lang=\"EN-US\">Nativo@75 WG (Bayer Company) 10 ग्राम प्रति टंकी (15 लीटर वाली )</span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-weight: 400; line-height: normal;\"><span lang=\"EN-US\"><span style=\"font-size: 14px;\">Streptomycin Sulfate 90% + Tetracycline Hydrochloride 10% (6 GM/1 Acre)</span></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0cm; font-weight: 400; line-height: normal;\"><span lang=\"EN-US\">दोनों को मिलाकर प्रयोग करें</span></p></span></span></span></li></ul>', 'पपीते में पाउडर फफूंदी के विकास को उच्च आद्रता या अत्यधिक नमी (80-85%) द्वारा तथा तापक्रम 24-26°C में अत्यधिक बढ़ावा मिलता है। यह बीमारी पौधे के पत्तों एवं फलों पर ज्यादा दिखाई देती है। संक्रमण पहले पत्तियों पर छोटे-छोटे काले क्षेत्रों के रूप में स्पष्ट होता है, जो बाद में सफेद पाउडर बन जाते हैं । ये धब्बे धीरे-धीरे बढ़ते चले जाते हैं और फिर पूरी पत्तियों या फलों पर फैल जाते हैं। गंभीर रूप से संक्रमित पत्तियां गिरने से पहले अपना रंग खो देती है  और विकृत हो सकती हैं। प्रभावित फल आकार में छोटे और विकृत होते हैं।', NULL),
(40, 'नींबू के खेत की तैयारी (Lemon Farm Preparation)', 'नींबू के खेत की तैयारी (Lemon Farm Preparation)', '', 2, 6, 1, '2022-07-07', '2022-08-16', 4, '[\"62c67b90af38d.jpg\",\"62c67b90af561.png\",\"62c67b90af74d.jpg\",\"62c67b90af957.png\",\"62fb789b870d9.png\"]', '<p style=\"font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\">प्रति  गड्ढा आवश्यक खाद एवं उर्वरक </p><p style=\"font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\"><span style=\"font-size: 0.875rem;\">10 KG सड़ी हुई गोबर की खाद </span></p><p style=\"font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\">500 Gram सिंगल सुपर फास्फेट  (SSP)  </p><p style=\"font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\">50 Gram ट्राइकोडरमा</p><p style=\"font-family: \"Source Sans Pro\", -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, \"Helvetica Neue\", Arial, sans-serif, \"Apple Color Emoji\", \"Segoe UI Emoji\", \"Segoe UI Symbol\"; font-size: 12px;\">दीमक की दवा </p>', 'पौधरोपण से 30 दिन पूर्व 2 x 2 फिट का गड्ढा करवाए तथा  उसे खुला छोड़ दे  फिर 15 दिन पश्चात् गड्ढे में से बाहर निकली हुई मिट्टी  में निम्नलिखित खाद  को मिलाकर गड्ढे को भर दे  तथा खेत में मसंचाई कर दे ताकि गड्ढे मे सारी खादे अच्छे से आपस मे घुल कर स्थिर  हो जाए |', 1);
